  \"2016-09-05T22:34:37.219022\",\n\t\"name\": \"national-geospatial-data-asset-ngda-continuously-operating-reference-stations-cors\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The National Geodetic Survey (NGS), an
  office of NOAA's National Ocean Service, manages a network of Continuously Operating
  Reference Stations (CORS) that provide Global Navigation Satellite System (GNSS)
  data consisting of carrier phase and code range measurements in support of three
  dimensional positioning, meteorology, space weather, and geophysical applications
  throughout the United States, its territories, and a few foreign countries. Surveyors,
  GIS users, engineers, scientists, and the public at large that collect GPS or GNSS
  data can use CORS data to improve the precision of their positions. CORS enhanced
  post-processed coordinates approach a few centimeters relative to the National Spatial
  Reference System, both horizontally and vertically. The CORS network is a multi-purpose
  cooperative endeavor involving government, academic, and private organizations.
  The sites are independently owned and operated. Each agency shares their data with
  NGS, and NGS in turn analyzes and distributes the data free of charge. As of August
  2016, the CORS network provides data from more than 1,950 active sites. CORS data
  holdings to include decommissioned stations, comes to a total of 2,674 sites. These
  sites are contributed by over 230 different organizations, and the network continues
  to expand.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
